import React from 'react';
import {sum,sub,mult,divi} from './Calc';

function App(){
    return (
        <> 
        <li>{ sum(12,12) }</li>
        <li>{ sub(12,12) }</li>
        <li>{ mult(12,12) }</li>
        <li>{ divi(12,12) }</li>
        </>
    )
}


export default App;
